import React, { Component } from "react";
import { TitleProp } from "./interface";

class Title extends React.Component<TitleProp> {
  render() {
    const { title } = this.props;

    return (
      <div>
        <header className="title">
          Testing
          {title}
        </header>
      </div>
    );
  }
}

